SELECT AVG(interest) AS average_interest_rate 
FROM deposits 
WHERE tem = '12M';

SELECT AVG(CAST(SUBSTRING(tem FROM '^[0-9]+') AS INTEGER)) AS average_term
FROM deposits
WHERE interest > 3.0;

SELECT COUNT(*) AS December_account_creations 
FROM accounts 
WHERE EXTRACT(MONTH FROM created_at) = 12;

SELECT COUNT(*) 
FROM transactions 
WHERE tran_amt > (SELECT AVG(tran_amt) FROM transactions);

SELECT MIN(tran_amt) AS min_transaction_amount 
FROM transactions 
WHERE DATE_TRUNC('month', tran_dt) = DATE_TRUNC('month', CURRENT_DATE);

SELECT AVG(bal) AS average_balance 
FROM deposits 
WHERE de_st_dt >= CURRENT_DATE - INTERVAL '30 days';

SELECT AVG(interest) AS average_interest_rate 
FROM deposits 
WHERE bal > 100000;
